import logo from './logo.svg';
import './App.css';
import React from 'react';
import {BrowserRouter as Router, Route, Link, Routes} from 'react-router-dom';
import BusinessForm from './components/BusinessForm';
import BusinessList from './components/BusinessList';
import CreatorForm from './components/CreatorForm';
import CreatorList from './components/CreatorList';

function App() {
  return (

    <Router>
      <h1>Hello Sunshine!!</h1>
      <h2>Welcome to Earth!!</h2>
      <div>

        <div>
                <nav>
                    <ul>
                        <li><Link to="/add-business">Add Business</Link></li>
                    </ul><ul>
                        <li><Link to="/add-creator">Add Creator</Link></li>
                    </ul>
                    <ul>
                        <li><Link to="/business-List">Business List</Link></li>
                    </ul>
                    <ul>
                        <li><Link to="/creator-list">Creator-list</Link></li>
                    </ul>
                </nav>
                <Routes>
                    <Route path="/add-business" element={<BusinessForm />} />
                    <Route path="/add-creator" element={<CreatorForm />} />
                    <Route path="/business-List" element={<BusinessList/>} />
                    <Route path="/creator-list" element={<CreatorList/>} />
                </Routes>
            </div>

      </div>
    </Router>
  );
}

export default App;
